class Solution {
public:
    int countCornerRectangles(vector<vector<int>>& grid) {
        // O(m*m*n) time
        int sum=0, ct; 
        for(int i=0; i<grid.size()-1; i++){
            for(int j=i+1; j<grid.size(); j++){
                ct=0;
                for(int k=0; k!=grid[0].size(); k++){
                    if(grid[i][k]+grid[j][k]==2){
                        ct++;
                    }
                }
                if(ct!=0)   sum+=ct*(ct-1)/2;
            }
        }
        return sum;
    }
};

